const NavigationMenu = () => {
  return (
    <div className="navigation">
     <ul className="navbar">
       <li>In Theatres</li>
       <li>Coming Soon</li>
       <li>Top Rated</li>
       <li>Top Rated Indian</li>
       <li>Favourites</li>
     </ul>
    </div>
  )
};

export default NavigationMenu;
